import { Card, Grid, Typography, } from '@material-ui/core'
import { ToggleButton } from '@material-ui/lab'
import DayIcon from '@material-ui/icons/WbSunnyTwoTone'
import NightIcon from '@material-ui/icons/NightsStayTwoTone'
import { useState } from 'react'

const AvailabilityComponent = () => {
    const [mondayMorning, setMondayMorning] = useState(true)
    const [mondayEvening, setMondayEvening] = useState(true)
    const [tuesdayMorning, setTuesdayMorning] = useState(true)
    const [wednesdayMorning, setWednesdayMorning] = useState(true)
    const [thursdayMorning, setThursdayMorning] = useState(true)
    const [fridayMorning, setFridayMorning] = useState(true)
    const [saturdayMorning, setSaturdayMorning] = useState(true)
    const [sundayMorning, setSundayMorning] = useState(true)

    return (
        <Card> 
            <Grid container justify="center" direction="column" align="center" xs={12} spacing={0}>
                <Typography>Availability</Typography>

                <Grid item container justify="space-around" direction="row"  spacing={0}>
                    <Typography>Mon</Typography>
                    <Typography>Tue</Typography>
                    <Typography>Wed</Typography>
                    <Typography>Thu</Typography>
                    <Typography>Fri</Typography>
                    <Typography>Sat</Typography>
                    <Typography>Sun</Typography>
                </Grid>

                <Grid item container justify="center" direction="row" spacing={0}>
                    <ToggleButton
                        value="check"
                        selected={mondayMorning}
                        size="small"
                        onChange={() => {
                            setMondayMorning(!mondayMorning);
                        }}
                    >
                        <DayIcon />
                    </ToggleButton>
                    <ToggleButton
                        value="check"
                        selected={mondayMorning}
                        size="small"
                        onChange={() => {
                            setMondayMorning(!mondayMorning);
                        }}
                    >
                        <DayIcon />
                    </ToggleButton>
                    <ToggleButton
                        value="check"
                        selected={mondayMorning}
                        size="small"
                        onChange={() => {
                            setMondayMorning(!mondayMorning);
                        }}
                    >
                        <DayIcon />
                    </ToggleButton>
                    <ToggleButton
                        value="check"
                        selected={mondayMorning}
                        size="small"
                        onChange={() => {
                            setMondayMorning(!mondayMorning);
                        }}
                    >
                        <DayIcon />
                    </ToggleButton>
                    <ToggleButton
                        value="check"
                        selected={mondayMorning}
                        size="small"
                        onChange={() => {
                            setMondayMorning(!mondayMorning);
                        }}
                    >
                        <DayIcon />
                    </ToggleButton>
                    <ToggleButton
                        value="check"
                        selected={mondayMorning}
                        size="small"
                        onChange={() => {
                            setMondayMorning(!mondayMorning);
                        }}
                    >
                        <DayIcon />
                    </ToggleButton>
                    <ToggleButton
                        value="check"
                        selected={mondayMorning}
                        size="small"
                        onChange={() => {
                            setMondayMorning(!mondayMorning);
                        }}
                    >
                        <DayIcon />
                    </ToggleButton>
                </Grid>

            </Grid>
        </Card>
    )
}

export default AvailabilityComponent
